// Step 1: Normalize dictionary keys to lowercase
const normalizedSVGs = {};
for (let key in conditionSVGs) {
    const normalizedKey = key.toLowerCase().trim().replace(/\s+/g, " ");
    normalizedSVGs[normalizedKey] = conditionSVGs[key];
}

// Step 2: Normalize the condition text from <h1>
function normalizeText(text) {
    return text
        .toLowerCase()
        .trim()
        .replace(/\s+/g, " "); // trim and collapse multiple spaces into one
}

// Step 3: Update SVG
function updateConditionSVG() {
    const conditionElement = document.querySelector("h1.condition");
    const svgContainer = document.querySelector(".svg_container");

    if (conditionElement && svgContainer) {
        const conditionText = normalizeText(conditionElement.textContent);

        if (normalizedSVGs[conditionText]) {
            svgContainer.innerHTML = normalizedSVGs[conditionText];
        } else {
            svgContainer.innerHTML = `<p>No SVG available for "${conditionText}"</p>`;
        }
    }
}

document.addEventListener("DOMContentLoaded", updateConditionSVG);
